import React from 'react'
import Card from './Card';
import './Card.css'
import Sdata from './Sdata';

const App = () => {
    return(
        <>
            <h1 className='heading_style'>LIST OF TOP 5 NETFLIX SERIES IN 2020</h1>
            {
                Sdata.map((val)=>{
                    return(
                        <Card 
                            imgsrc = {val.imgsrc}
                            title = {val.title}
                            sname = {val.sname}
                            links = {val.links}
                        />
                    )
                })
            }
        </>
    );
}

export default App
